Count 1 - child neglect - No contest plea.  Convicted.
State moves to dismiss and read in Count 2.  Motion granted.
Sentence is withheld.  Defendant is placed on probation to DOC for twelve (12) months.  Conditions of probation:
1) COMPAS assessment and follow through;
2) Comply with CHIPS order until expiration;
3) Maintain full-time work, school or combination;
4) Maintain absolute sobriety;
5) Random drug screens and pays for same;
6) Thirty (30) days jail, stayed to be imposed at agents discretion;
7) Provide DNA sample and pay surcharge;
8) Pay costs of the action; and
9) Pay supervision fees in an amount to be determined by DOC.
The Court orders expungement under Section 973.015 upon successful completion of the sentence.
Minutes.
